import './App.css';
import NavBar from './Navbar';
import AppRoutes from './Routes';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <NavBar/>
      </header>
      <main>
        <AppRoutes/>
      </main>
    </div>
  );
}

export default App;
